import { React, useState, useEffect } from "react";

import './AdminInterface.css';

export default function AdminInterface({ questions = null, sessions = null }) {
  return (
    <div className="main">
      <div className="sessionlist">

        <select>
          { Object.keys(questions).map(sessions => (
            <option key={sessions.id} value={sessions.id}>{sessions.id}</option>
          ))}
        </select>
        <button>New Session</button>
      </div>
      <div className="sessiondetails">
        <label>Id:</label>
        <input type="text" readOnly />
        <label>Duration:</label>
        <input type="text" />
        <label>Question:</label>
        <select>
          { Object.keys(questions).map(question => (
            <option key={question.id} value={question.id}>{question.prompt}</option>
          ))}
        </select>
      </div>
      <div className="startsession">
        <button>Start</button>
        <input type="text" readOnly />
      </div>
    </div>
  );
}
